<!DOCTYPE html>
<html>
<head>
<meta charset="utf-8"/>
<meta http-equiv="X-UA-Compatible" content="IE=edge"/>
<title>Untitled</title>
<script type="text/javascript" src="lib/dojo/dojo/dojo.js" data-dojo-config="'parseOnLoad':true,'async':true,'packages':[{'name':'gridx','location':'../gridx'},{'name':'clipart','location':'../../clipart'},{'name':'maqettaSamples','location':'../../../samples'},{'name':'maqetta','location':'../../maqetta'},{'name':'shapes','location':'../../shapes'},{'name':'zazl','location':'../../zazl'},{'name':'widgets','location':'../../custom'}],'themeMap':[['Android','',['themes/android/android.css']],['BlackBerry','',['themes/blackberry/blackberry.css']],['iPad','',['themes/ipad/ipad.css']],['iPhone','',['themes/iphone/iphone.css']],['.*','',['themes/iphone/iphone.css']]],'mblThemeFiles':[],'mblLoadCompatPattern':''"></script>
<script type="text/javascript">
require([
  "dijit/dijit",
  "dojo/parser",
  "maqetta/space",
  "maqetta/AppStates",
  "dijit/layout/ContentPane",
  "dijit/form/Button"
]);
</script>
<style>@import "themes/claro/document.css";@import "themes/claro/claro.css";@import "app.css";
</style>
<script type="text/javascript" src="app.js"></script>
</head>
<body data-maq-flow-layout="true" data-maq-comptype="desktop" class="claro" data-maq-ws="collapse" id="myapp" data-maq-appstates="{'states':['processing','complete'],'current':'complete','initial':'processing','focus':'complete'}">
 <div data-dojo-type="dijit/layout/ContentPane" title="Pane" extractContent="false" preventCache="false" preload="false" refreshOnShow="false" style="width: 100%;" doLayout="false" class="mmContentPane" data-maq-deltas="{'complete':{'style':[{'display':'none'}]}}"><span style="display: none; width: 100%; top: 80px; text-align: center;" class="mainSpan" data-maq-deltas="{'processing':{'style':[{'display':''}]}}">Processing</span></div>
 <div data-dojo-type="dijit/layout/ContentPane" title="Pane" extractContent="false" preventCache="false" preload="false" refreshOnShow="false" style="width: 100%; display: none;" doLayout="false" class="mmContentPane" data-maq-deltas="{'complete':{'style':[{'display':''}]}}" onclick="location.href='e4a_main.html'">
<input type="button" data-dojo-type="dijit/form/Button" intermediateChanges="false" label="Go back to&lt;br&gt; Main Menu" iconClass="dijitNoIcon" style="display: none; top: 70%; position: fixed; right: 15%;" class="mmButton" data-maq-deltas="{'complete':{'style':[{'display':''}]}}"></input>
<span style="display: none; top: 80px; width: 100%; text-align: center;" class="mainSpan" data-maq-deltas="{'complete':{'style':[{'display':''}]}}">Done!</span><span id="resultsFromProcesssing" style="display: none; width: 80%; left: 10%; top: 160px;" class="mainSpan" data-maq-deltas="{'complete':{'style':[{'display':''}]}}"></span></div>
</body>
</html>
